import Task from "./Task";
import './Note.css';
import Form from './Form';

function Note() {
    const sampleData = {
        description: { title: "Sample Title", content: "Sample Content" },
        date: { hour: 10, minute: 30, day: 27, month: 9, year: 2024 },
        id: 1,

    };
    
    const sizeMax = {
        overflowY: 'auto', /* Add vertical scroll if content exceeds height */
        maxHeight: '700px', /* Set a maximum height for the container  */
        maxWidth: '650px'
    }
    return (
        <>
            <div className="note-container ">


                <div>
                    <div style={sizeMax}>
                        <Task {...sampleData} />
                    </div>

                    <div className="agent" > 
                        <dev style={sizeMax}>
                            <Form />
                        </dev>
                         
                    </div>

                </div>

                <div className="analysis" >
                    <div>
                        <p> analysis here </p>
                    </div>
                </div>

            </div>

        </>
    );
}

export default Note;
